      SELECT ALL col1 AS col1 FROM tab0 WHERE NOT + col0 IN ( + col1 * 18, 24 * - + ( 22 ), + + col1 * - col1 * col2 * - CAST ( + + col1 AS INTEGER ) );
  - name: tab0

outputs:
